import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import { Container, Paper } from '@mui/material';
import Button from '@mui/material/Button';

export default function Patient() {
  const paperStyle={padding:'50px 20px', with:600, margin:"20px auto", textAlign: 'center', fontFamily: 'Arial, sans-serif'}
  const h1Style = {margin: '0', marginBottom: '20px', fontFamily: 'Helvetica, sans-serif'}

  const [dni,setDni]=React.useState('')
  const [lastname,setLastname]=React.useState('')
  const [firstname,setFirstname]=React.useState('')
  const [phone,setPhone]=React.useState('')
  const [address,setAddress]=React.useState('')
  const [patients, setPatients]=React.useState([])

  const handleClick=(e)=>{
    e.preventDefault()
    const patient={dni,lastname,firstname,phone,address}
    console.log(patient)
    fetch("http://localhost:8080/api/v1/patient/add",{
      method:"POST",
      headers:{"Content-Type":"application/json"},
      body:JSON.stringify(patient)
    }).then(()=>{
      console.log("Se agrego el paciente: "+ patient.firstname);
    })
  }

  React.useEffect(() => {
    fetch("http://localhost:8080/api/v1/patient/getAll")
    .then(res=>res.json())
    .then((result)=>{
      setPatients(result);
    }
  )
  },[])
  


  return (
    <Container>
     <Paper elevation={3} style={paperStyle}>
      <h1 style={h1Style}>Registrar Paciente</h1>
      <Box
        component="form"
        sx={{
          '& > :not(style)': { m: 1, width: "100%" },
        }}
        noValidate
        autoComplete="off"
      >
        <TextField id="outlined-basic" label="DNI" variant="outlined" fullWidth
        value={dni}
        onChange={(e)=>setDni(e.target.value)}
        />
        <TextField id="outlined-basic" label="APELLIDOS" variant="outlined" fullWidth
        value={lastname}
        onChange={(e)=>setLastname(e.target.value)}
        />
        <TextField id="outlined-basic" label="NOMBRES" variant="outlined" fullWidth
        value={firstname}
        onChange={(e)=>setFirstname(e.target.value)}
        />
        <TextField id="outlined-basic" label="CELULAR" variant="outlined" fullWidth
        value={phone}
        onChange={(e)=>setPhone(e.target.value)}
        />
        <TextField id="outlined-basic" label="DIRRECIÓN" variant="outlined" fullWidth
        value={address}
        onChange={(e)=>setAddress(e.target.value)}
        />
      </Box>
      <Button variant="contained" onClick={handleClick}>Registrar</Button>
      </Paper> 
      <h1>Pacientes</h1> 

      <Paper elevation={3} style={paperStyle}>

         {patients.map(patient=>(
          <Paper elevation={6} style={{margin:"10px",padding:"15px",textAlign:"left"}}>
            Dni: {patient.dni} <br/>
            Nombres: {patient.lastname} <br/>
            Apellidos: {patient.firstname} <br/>
            Celular: {patient.phone} <br/> 
            Dirección: {patient.address} <br/>
          </Paper>
         ))}



      </Paper>


    </Container>
  );
}
